import React from "react";

export default function Projects() {
  const projects = [
    { title: "Portfolio Website", description: "Built with React and Tailwind." },
    { title: "AI Chatbot", description: "Custom chatbot with Node backend." },
    { title: "Cool App", description: "Another cool app description." },
  ];

  return (
    <section id="projects" className="py-24 px-6 max-w-6xl mx-auto text-center">
      <h2 className="text-3xl font-bold mb-12 text-purple-400">Projects</h2>
      <div className="grid md:grid-cols-3 gap-8">
        {projects.map((p, i) => (
          <div
            key={i}
            className="bg-black dark:bg-darkBlue border border-purple-500 rounded-xl p-6 shadow-lg hover:scale-105 transition-transform cursor-target"
          >
            <h3 className="text-xl font-bold mb-3 text-purple-300">{p.title}</h3>
            <p className="text-gray-300">{p.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
}
